import { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";
import "../Register.css";

const Register = () => {
  const [user, setUser] = useState("");
  const [pass, setPass] = useState("");
  const [role, setRole] = useState("");
  const [balance, setBalance] = useState("");

  const onSubmit = (e) => {
    e.preventDefault();

    // nu avem nevoie de 2 usernameuri identice

    setUser("");
    setPass("");
    setRole("");
    setBalance(0);
  };

  const onReset = (e) => {
    e.preventDefault();
    setUser("");
    setPass("");
    setRole("");
    setBalance(0);
  };

  return (
    <div
      className="Appp"
      style={{
        position: "absolute",
        left: "50%",
        top: "50%",
        transform: "translate(-50%, -50%)",
      }}
    >
      <form className="formm" onSubmit={onSubmit}>
        <div className="input-grouppp">
          <i class="far fa-camera"></i>
          <label> Username</label>
          <input
            type="text"
            value={user}
            placeholder="Enter username"
            onChange={(e) => setUser(e.target.value)}
          />
        </div>
        <div className="input-grouppp">
          <label>Password</label>
          <input
            type="password"
            value={pass}
            placeholder="Enter password"
            onChange={(e) => setPass(e.target.value)}
          />
        </div>
        <div className="input-grouppp">
          <label> Balance </label>
          <input
            type="text"
            value={balance}
            placeholder="Enter the balance"
            onChange={(e) => setBalance(e.target.value)}
          />
        </div>

        <div className="input-grouppp">
          <label>Role select</label>
          <select onChange={(e) => setRole(e.target.value)}>
            <option>CLIENT</option>
            <option>SELLER</option>
          </select>
        </div>
        <a href="http://localhost:3000/">
          <button className="primaryyy buttonnn"> Sign in</button>
        </a>
      </form>
      <button className="secondaryyy buttonnn" onClick={onReset}>
        Reset fields
      </button>
    </div>
  );
};

export default Register;
